    false,nt"url": null,nt"notes": "The U.S. daily temperature analyses are
    maps depicting various temperature quantities utilizing daily maximum and minimum
    temperature data across the US. Maps are available for the daily maximum and minimum
    temperatures and anomalies, mean temperatures, and mean temperature anomalies averaged
    over various time scales (daily, 5-day, 7-day, 30-day, 90-day, and current month-to-date).
    Each of these quantities are available in terms of degrees Celsius and Fahrenheit.
    The graphics are updated daily and the graphics reflect the updated analyses including
    the latest daily data available. Archived graphics are rotated every year, making
    the previous and current year (to present) graphics available.",nt"license_title":
